const inputData = $input.all()[0].json;

console.log('Input data received:', JSON.stringify(inputData, null, 2));

// Extract data from AI Agent
let dadosDoAgent = null;

if (inputData.output && typeof inputData.output === 'object') {
  dadosDoAgent = inputData.output;
} else if (inputData.chatInput) {
  dadosDoAgent = inputData.chatInput;
} else if (inputData.message) {
  dadosDoAgent = inputData.message;
}

console.log('Dados extraÃ­dos do agent:', JSON.stringify(dadosDoAgent, null, 2));

// Initialize variables
let nome = '';
let projeto = '';
let email = '';
let whatsapp = '';
let respostas = {};
let pontuacao = 0;
let isComplete = false;
let perguntasMultiplaEscolha = [];

if (dadosDoAgent) {
  nome = dadosDoAgent.nome || '';
  projeto = dadosDoAgent.projeto || '';
  email = dadosDoAgent.email || '';
  whatsapp = dadosDoAgent.whatsapp || '';
  respostas = dadosDoAgent.respostas || {};

  // Separar pergunta e opÃ§Ãµes numeradas do texto da resposta
  if (dadosDoAgent.resposta) {
    // CORREÃ‡ÃƒO: Preservar quebras de linha no texto original
    const textoOriginal = dadosDoAgent.resposta.trim();

    // Regex para capturar opÃ§Ãµes numeradas, considerando quebras de linha
    const regexOpcoes = /(?:\(\s*\)\s*)?(\d\s*-\s*[^\n\r(]+)/g;
    const opcoes = [];
    let match;

    while ((match = regexOpcoes.exec(textoOriginal)) !== null) {
      const opcaoLimpa = match[1].trim();
      opcoes.push(opcaoLimpa);
    }

    // Remove as opÃ§Ãµes do texto para extrair apenas a pergunta
    // MantÃ©m as quebras de linha na pergunta
    let textoPergunta = textoOriginal.replace(regexOpcoes, '').trim();

    // Remove linhas vazias excessivas (mais de 2 quebras consecutivas)
    textoPergunta = textoPergunta.replace(/\n{3,}/g, '\n\n');

    // CONVERSÃƒO DE QUEBRAS DE LINHA PARA Z-API
    // Converte quebras reais para \n literal que a Z-API aceita
    textoPergunta = textoPergunta
      .replace(/\n/g, '\\n')        // Quebra real vira \n literal
      .replace(/\r\n/g, '\\n')      // Windows line break
      .replace(/\r/g, '\\n');       // Mac line break

    if (opcoes.length > 0 && textoPergunta.length > 0) {
      perguntasMultiplaEscolha.push({
        pergunta: textoPergunta,
        opcoes: opcoes
      });
    }
  }

  console.log('Dados processados:', {
    nome, projeto, email, whatsapp, respostas
  });

  // Verificar se todos os campos obrigatÃ³rios foram preenchidos
  const dadosCompletos = nome && projeto && email && whatsapp;

  // Verificar se todas as respostas obrigatÃ³rias estÃ£o completas
  const respostasCompletas = respostas && 
    (respostas.modeloNegocio === "true" || respostas.modeloNegocio === "false") &&
    (respostas.tamSamSom === "true" || respostas.tamSamSom === "false") &&
    ['dados_organizados', 'informal', 'nao_realizei'].includes(respostas.pesquisaQualitativa) &&
    ['dados_organizados', 'informal', 'nao_realizei'].includes(respostas.concorrentes) &&
    (respostas.persona === "true" || respostas.persona === "false") &&
    (respostas.pitch === "true" || respostas.pitch === "false") &&
    (respostas.programasAnteriores === "true" || respostas.programasAnteriores === "false");

  console.log('ValidaÃ§Ã£o detalhada:', {
    dadosCompletos,
    respostasCompletas,
    modeloNegocio: respostas.modeloNegocio,
    tamSamSom: respostas.tamSamSom,
    pesquisaQualitativa: respostas.pesquisaQualitativa,
    concorrentes: respostas.concorrentes,
    persona: respostas.persona,
    pitch: respostas.pitch,
    programasAnteriores: respostas.programasAnteriores,
    nome, projeto, email, whatsapp
  });

  // Calcular pontuaÃ§Ã£o
  pontuacao = 0;
  pontuacao += (respostas.modeloNegocio === "true") ? 1 : 0;
  pontuacao += (respostas.tamSamSom === "true") ? 1 : 0;

  if (respostas.pesquisaQualitativa === 'dados_organizados') {
    pontuacao += 2;
  } else if (respostas.pesquisaQualitativa === 'informal') {
    pontuacao += 1;
  }

  if (respostas.concorrentes === 'dados_organizados') {
    pontuacao += 2;
  } else if (respostas.concorrentes === 'informal') {
    pontuacao += 1;
  }

  pontuacao += (respostas.persona === "true") ? 1 : 0;
  pontuacao += (respostas.pitch === "true") ? 1 : 0;

  pontuacao = parseInt(pontuacao) || 0;

  console.log('PontuaÃ§Ã£o calculada:', pontuacao);

  if (dadosCompletos && respostasCompletas) {
    isComplete = true;
  }
}

// Definir resultado com base na pontuaÃ§Ã£o
let resultado = '';
let status = '';

if (isComplete) {
  if (pontuacao === 8) {
    resultado = 'Aprovado para IncubaÃ§Ã£o';
    status = 'aprovado_incubacao';
  } else if (pontuacao >= 4 && pontuacao <= 7) {
    resultado = 'Trilha AvanÃ§ada';
    status = 'trilha_avancada';
  } else {
    resultado = 'Trilha Inicial';
    status = 'trilha_inicial';
  }
}

// Preparar saÃ­da
const respostasOutput = {
  modeloNegocio: respostas.modeloNegocio === "true" ? true : respostas.modeloNegocio === "false" ? false : respostas.modeloNegocio,
  tamSamSom: respostas.tamSamSom === "true" ? true : respostas.tamSamSom === "false" ? false : respostas.tamSamSom,
  pesquisaQualitativa: respostas.pesquisaQualitativa,
  concorrentes: respostas.concorrentes,
  persona: respostas.persona === "true" ? true : respostas.persona === "false" ? false : respostas.persona,
  pitch: respostas.pitch === "true" ? true : respostas.pitch === "false" ? false : respostas.pitch,
  programasAnteriores: respostas.programasAnteriores === "true" ? true : respostas.programasAnteriores === "false" ? false : respostas.programasAnteriores
};

const output = {
  nome: nome,
  projeto: projeto,
  email: email,
  whatsapp: whatsapp,
  pontuacao: Number(pontuacao),
  resultado: resultado,
  status: status,
  respostas: respostasOutput,
  perguntasMultiplaEscolha,
  timestamp: new Date().toISOString(),
  output: isComplete ? 'concluido' : 'em_andamento',
  isComplete: isComplete,
  dadosOriginais: dadosDoAgent
};

console.log('Output final:', JSON.stringify(output, null, 2));

return { json: output };

